import React, { useEffect, useState } from "react";
import { apiUrl } from "../App";
import axios from "axios";

// Components :
import Table from "./Table";
import NavBar from "./NavBar";

function Dashboard() {
  const [docketDetails, setDocketDetails] = useState([]);
  const getDocketDetails = async () => {
    try {
      const req = {
        action: "getDocket",
      };
      const res = await axios.post(`${apiUrl}/docketDetails`, req);
      if (res.status == 200) {
        setDocketDetails(res.data.result);
      }
    } catch (error) {
      console.log("error: ", error);
    }
  };
  useEffect(() => {
    getDocketDetails();
  }, []);

  const column = [
    {
      name: <h1>S.No</h1>,
      width: "60px",
      cell: (row, index) => <div className="text-[#6D6D6D]">{index + 1}</div>,
    },
    {
      name: <h1>Name</h1>,
      width: "auto",
      cell: (row, index) => <div className="text-[#6D6D6D]">Ganesh</div>,
    },
    {
      name: <h1>Start Time</h1>,
      width: "auto",
      cell: (row, index) => <div className="text-[#6D6D6D]">12:00</div>,
    },
    {
      name: <h1>End Time</h1>,
      width: "auto",
      cell: (row, index) => <div className="text-[#6D6D6D]">02:00</div>,
    },
    {
      name: <h1>No of hours worked</h1>,
      width: "auto",
      cell: (row, index) => <div className="text-[#6D6D6D]">02:00</div>,
    },
    {
      name: <h1>Rate per hour</h1>,
      width: "auto",
      cell: (row, index) => <div className="text-[#6D6D6D]">02:00</div>,
    },
  ];

  return (
    <div>
      <div className="flex flex-col">
        <NavBar />
        <Table column={column} data={docketDetails} />
      </div>
    </div>
  );
}

export default Dashboard;
